fields.formula:
if( 
  equal( 
    join(totext(lookup("Question ID", "Role")), ""), 
    join(totext(lookup("Interview ID", "Role")), "") 
  ), 
  true, 
  false 
)

join( 
  if( 
    or( 
      trunc(tonumber(right(totext(field("Interview ID")), 1))) = 1, 
      trunc(tonumber(right(totext(field("Interview ID")), 1))) = 6 
    ), 
    "S", 
    if( 
      or( 
        trunc(tonumber(right(totext(field("Interview ID")), 1))) = 2, 
        trunc(tonumber(right(totext(field("Interview ID")), 1))) = 7 
      ), 
      "Y", 
      if( 
        or( 
          trunc(tonumber(right(totext(field("Interview ID")), 1))) = 3, 
          trunc(tonumber(right(totext(field("Interview ID")), 1))) = 8 
        ), 
        "G", 
        if( 
          or( 
            trunc(tonumber(right(totext(field("Interview ID")), 1))) = 4, 
            trunc(tonumber(right(totext(field("Interview ID")), 1))) = 9 
          ), 
          "R", 
          "B" 
        ) 
      ) 
    ) 
  ), 
  "" 
)
